"use strict";class TimelineChannel{constructor(type,engine,showPlayMarker=false,events,muted){this.type=type;this.engine=engine;this.showPlayMarker=showPlayMarker;this.muted=muted;this.events=events||[]}addEvent(event){const lastEvent=this.events[this.events.length-1];if(lastEvent&&event.time<lastEvent.time){let i=this.events.length;while(i--&&this.events[i].time>event.time){}this.events.splice(i+1,0,event)}else{this.events.push(event)}return event}mute(){this.muted=true}unmute(){this.muted=false}cancel(){this.engine.cancel()}destroy(){this.engine.destroy()}}export default TimelineChannel;"";